// models/subcategoria.models.js
import { DataTypes } from "sequelize";
import { sequelize } from "../bd_config/conexion";
import { Categoria } from "./categoria.models"; // Asegúrate de que la ruta sea correcta

export const Subcategoria = sequelize.define("subcategoria", {
    idSubcategoria: {
        type: DataTypes.INTEGER,
        primaryKey: true,
        autoIncrement: true,
    },
    nombre: DataTypes.STRING,
});

// Define las relaciones aquí
Categoria.hasMany(Subcategoria, {
    foreignKey: "idCategoria",
    sourceKey: "idCategoria",
    as: "subcategorias", // Asegúrate de que el alias sea plural
});

Subcategoria.belongsTo(Categoria, {
    foreignKey: "idCategoria",
    targetKey: "idCategoria",
    as: "categoria",
});

